import {palette} from './palette';



export const components ={

  MuiTextField: {
    styleOverrides: {
      root: {
        '& label.Mui-focused': {
          color: '#c7c7c7',
        },
      },
    },
    defaultProps: {
      InputLabelProps: {
        style: {
          textAlign: 'center',
          justifyContent:'center'
        },
      },
    },
  },
  MuiOutlinedInput: {
    styleOverrides: {
      root: {
        backgroundColor: "#FFF",
      },
    },
  },
  MuiInputLabel:{
    styleOverrides:{
      root:{
        color: '#a2a2a2',
      }
    }
  }
}
